<!DOCTYPE html>
<html>

<head>
    <meta charset="utf-8">
    <title>Raijin</title>
    <link rel="stylesheet" href="//fonts.googleapis.com/css?family=Asap">
    <link rel="stylesheet" href="//cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/3.3.2/css/bootstrap.min.css">

    <script src="../static/js/jquery-2.2.3.js"></script>
    <script src="../static/js/jRate.js"></script>
    <style type="text/css">
        * {
            font-family: 'Asap';
        }
    </style>

    <script>
        var sectionId = 1;
        $(function() {
            $.ajax({
                url: '/getMovies',
                type: 'GET',
                success: function(res) {
                    var div = $('<div>')
                        .attr('class', 'col-sm-3')
                        .append($('<div>')
                            .attr('class', 'thumbnail')
                            .append($('<img>')
                                .attr('src', '../static/images/movie_poster.jpg'),
                                $('<div>')
                                .attr('class', 'caption')
                                .append($('<h4>')
                                    .attr('style', 'margin-bottom: 24px; text-overflow: ellipsis; white-space: nowrap; overflow: hidden;'),
                                    $('<h5>')
                                    .attr('style', 'margin-bottom: 24px; text-overflow: ellipsis; white-space: nowrap; overflow: hidden;'),
                                    $('<div>')
                                    .attr('class', 'row')
                                    .append($('<div>')
                                        .attr({
                                          
                                            class: 'jRate',
                                            style: 'height:50px;width: 400px;margin-left: 15px;'
                                        })
                                    )
                                )))

                    var movieObj = JSON.parse(res);
                    var movie = '';

                    $.each(movieObj, function(index, value) {
                        movie = $(div).clone();
                        $(movie).find('h4').text(value.movieName);
                        $(movie).find('h5').text(value.movieCategory);
						$(movie).find('.jRate').attr('id',"section"+sectionId++);
                        $(document.getElementById("innerMostRow")).append(movie);
                    });
                },
                error: function(error) {
                    console.log(error);
                }
            });
        });
    </script>

	<script>
	$(document).ready(function(){
		$("#submitButton").click(function() { 
		
		ratingData = {}
		console.log("inside button click")
			for (var i = 1; i<= 3883; i++){
		   ratingData[i] = parseInt($("#section"+i).attr("data-rating")); 
		}	
		
			$.ajax({
				url: '/userRatings',
				type: 'POST',
				data: {'ratings':ratingData},
				success: function (result) {
				     var iframe = document.createElement('iframe');
					 iframe.style.width = 100 + "%";
					 iframe.style.height = 2300 + "px";
					 
					 $(document.getElementById("Recom")).append(iframe);
					 iframe.contentWindow.document.open();
					iframe.contentWindow.document.write(result);
					iframe.contentWindow.document.close();
					
				}
			});  

	});
});
	
</script>
